import { Link } from 'react-router-dom';
import { Switch, Route, useLocation } from 'react-router-dom';


const logoSrc = require('../assets/images/logo-black.png').default;

const Header = () => {
  const location = useLocation();

  return (
    <header>
      <nav className="l-nav nav" id="top">
        <img src={logoSrc} className="nav-logo" alt="Logo"/>
        <Switch>
          <Route path={ location.pathname == '/login' || location.pathname == '/register'}>
            <Link to="/" className="nav-session">CLOSE</Link>
          </Route>
          {/* <Route path="/register">
            <Link to="/" className="nav-session">CLOSE</Link>
          </Route> */}
          <Route path="/">
            <Link to="/login" className="nav-session">LOGIN</Link>
          </Route>
        </Switch>
      </nav>
    </header>
  )
}

export default Header;
